Description:
Теническая полиэтиленовая плёнка. Тип: рукав; цвет: прозрачный; размер: 1500 (х2) рукав, 100 м.п. Техническая пленка применяется:
для разделения слоев дорожного полотна; для кровельных работ;
для гидроизоляции строительных конструкций и ветрозащиты; для гидроизоляции и покрытия тепловой изоляции трубопроводов; для укрывных работ.
